package components.mainpanel;

import java.util.ArrayList;
import java.util.List;
import components.pendulum.imageprotractor.ImageProtractor;
import components.pendulum.imageprotractor.ImageProtractorInterface;
import components.pendulum.pendulum.ObserverPendulum;
import components.pendulum.pendulum.ObserverPendulumInterface;
import components.ruler.Ruler;
import components.ruler.RulerInterface;
import models.pendulum.PendulumModelFactory;
import models.pendulum.PendulumModelInterface;
import util.annotations.EditablePropertyNames;
import util.annotations.PropertyNames;
import util.annotations.StructurePattern;
import util.annotations.StructurePatternNames;
import util.annotations.Visible;

@StructurePattern(StructurePatternNames.BEAN_PATTERN)
@PropertyNames({"numberOfPendulum", "gravity", "friction", "pendulum", "ruler", "protractor", })
@EditablePropertyNames({"gravity", "friction", "pendulum", "ruler", "protractor"})
public class MainPanel implements MainPanelInterface{

	public static double gravity = PendulumModelFactory.DEFAULT_GRAVITY, 
			friction = PendulumModelFactory.DEFAULT_FRICTION;
	private int numberOfPendulum = 0;
	private List<ObserverPendulumInterface> pendulum = new ArrayList<ObserverPendulumInterface> ();
	private RulerInterface ruler = new Ruler(20, 20, 675, 60);
	private ImageProtractorInterface protractor = new ImageProtractor(100, -80, 200, 200);
	private boolean enable = true;


	public MainPanel() {
		increaseNumberOfPendulum();
	}

	@Override
	public void setGravity(double g) {
		gravity = g;
		setModel();
	}

	@Override
	public void setFriction(double f) {
		friction = f;
		setModel();
	}

	@Override
	public double getGravity() {
		return gravity;
	}

	@Override
	public double getFriction() {
		return friction;
	}


	@Override
	public List<ObserverPendulumInterface> getPendulum() {
		return pendulum;
	}


	@Override
	public RulerInterface getRuler() {
		return ruler;
	}

	@Override
	public void setRuler(RulerInterface newRuler) {
		ruler = newRuler;
	}


	@Override
	public int getNumberOfPendulum() {
		return numberOfPendulum;
	}


	@Override
	public ImageProtractorInterface getProtractor() {
		return protractor;
	}

	@Override
	public void setProtractor(ImageProtractorInterface newProtractor) {
		protractor = newProtractor;
	}

	@Override
	@Visible(false)
	public void setModel() {
		for (int i = 0; i < numberOfPendulum; i ++) {
			pendulum.get(i).setModel();
		}
	}

	@Override
	public void pause() {
		if (enable) {
			for (int i = 0; i < numberOfPendulum; i ++) {
				pendulum.get(i).stop();
			}
			enable = false;
		}
		else {
			for (int i = 0; i < numberOfPendulum; i ++) {
				pendulum.get(i).resume();
			}
			enable = true;
		}
	}

	@Override
	public void reset() {
		for (int i = 0; i < numberOfPendulum; i ++) {
			pendulum.get(i).setAngle(0);
		}
	}

	@Override
	public void increaseNumberOfPendulum() {
		if (numberOfPendulum < PendulumModelFactory.MAX_CAPACITY) {
			PendulumModelInterface newModel = PendulumModelFactory.getDefaultModel();
			pendulum.add(new ObserverPendulum(newModel, enable));
			numberOfPendulum ++;
		}
	}

	@Override
	public void decreaseNumberOfPendulum() {
		if (numberOfPendulum > 0) {
			numberOfPendulum --;
			pendulum.get(numberOfPendulum).getAnimator().interrupt();
			pendulum.get(numberOfPendulum).getModel().removePropertyChangeListener(pendulum.get(numberOfPendulum));
			pendulum.remove(numberOfPendulum);
		}
	}


}

package comp533.mvc;

import java.beans.PropertyChangeEvent;
import java.beans.PropertyChangeListener;
import java.beans.PropertyChangeSupport;
import java.util.ArrayList;
import java.util.HashMap;
import java.util.LinkedList;
import java.util.List;
import java.util.Map;
import java.util.Map.Entry;
import java.util.concurrent.ArrayBlockingQueue;
import java.util.concurrent.BlockingQueue;

import comp533.barrier.Barrier;
import comp533.barrier.BarrierInterface;
import comp533.children.Children;
import comp533.joiner.Joiner;
import comp533.joiner.JoinerInterface;
import comp533.keyValue.KeyValue;
import comp533.listenersupport.PropertyListenerSupport;
import comp533.mapreduce.MapperFactory;
import comp533.mapreduce.MapperInterface;
import comp533.mapreduce.ReducerFactory;
import comp533.mapreduce.ReducerInterface;
import comp533.tracer.TracerToString;


public class Model<K, V> extends TracerToString implements ModelInterface<K, V>{

	private String inputString;
	private Map<K, V> result = new HashMap<K, V> ();
	private PropertyListenerSupport propertyListenerSupport = new PropertyListenerSupport();
	private int numThreads = 0;
	private List<Thread> threads = new ArrayList<Thread> ();
	private List<Runnable> runnables = new ArrayList<Runnable>();
	private BlockingQueue<KeyValue<K, V>> keyValueQueue = new ArrayBlockingQueue<KeyValue<K, V>> (BUFFER_SIZE);
	private List<LinkedList<KeyValue<K, V>>> reductionQueueList = new ArrayList<LinkedList<KeyValue<K, V>>> ();
	private JoinerInterface joiner;
	private BarrierInterface barrier;
	private static final String RESULT = "Result";
	private static final String INPUT_STRING = "InputString";
	private static final String SPACE = " ";
	private static final String NUMTHREADS = "NumThreads";
	public static final String NAME = "Model";
	public static final String THREADS = "Threads";


	public Model() {
		super(Model.NAME);
	}

	@Override
	public void addPropertyChangeListener(final PropertyChangeListener aListener) {
		propertyListenerSupport.addElement(aListener);
	}

	@Override
	public void removePropertyChangeListener(final PropertyChangeListener aListener) {
		propertyListenerSupport.removeElement(aListener);
	}

	@Override
	public void setInputString(final String aInputString) {
		final String oldInputString = this.inputString;
		inputString = aInputString;
		propertyListenerSupport.notifyAllListeners(
				new PropertyChangeEvent(this, INPUT_STRING, oldInputString, inputString));
	}

	@Override
	public void mapreduce() {

		Map<K, V> oldResult = result;

		for (int i = 0; i < numThreads; i ++) {
			((Children) runnables.get(i)).childrenNotify();
		}

		final MapperInterface<K, V> mapper = (MapperInterface<K, V>) MapperFactory.getMapper();

		for (String key : this.inputString.split(SPACE)) {
			KeyValue<K, V> enqueueKeyValue = (KeyValue<K, V>) mapper.map(key);
			// Trace Enqueue Request
			traceEnqueueRequest(enqueueKeyValue);
			try {
				keyValueQueue.put(enqueueKeyValue);
			} catch (InterruptedException e) {
				e.printStackTrace();
			}
			// Trace Enqueue
			traceEnqueue(keyValueQueue);
		}

		for (int i = 0; i < numThreads; i ++) {
			KeyValue<K, V> enqueueKeyValue = new KeyValue<K, V> (null, null);
			// Trace Enqueue Request
			traceEnqueueRequest(enqueueKeyValue);
			try {
				keyValueQueue.put(enqueueKeyValue);
			} catch (InterruptedException e) {
				e.printStackTrace();
			}
			// Trace Enqueue
			traceEnqueue(keyValueQueue);
		}

		joiner.join();

		System.out.println("OK");

		propertyListenerSupport.notifyAllListeners(
				new PropertyChangeEvent(this, RESULT, oldResult, result));
	}

	@Override
	public String getInputString() {
		return this.inputString;
	}

	@Override
	public Map<K, V> getResult() {
		return this.result;
	}

	@Override
	public void setNumThreads(final int newNumThread) {
		final int oldNumThreads = numThreads;
		final List<Thread> oldThreads = threads;
		numThreads = newNumThread;
		barrier = new Barrier(numThreads);
		joiner = new Joiner(numThreads);

		propertyListenerSupport.notifyAllListeners(
				new PropertyChangeEvent(this, NUMTHREADS, oldNumThreads, numThreads));

		for (int i = 0; i < newNumThread; i ++) {
			final Runnable newChildren = new Children(i, (ModelInterface<String, Integer>) this);
			runnables.add(newChildren);
			threads.add(new Thread(newChildren));
			reductionQueueList.add(new LinkedList<KeyValue<K, V>> ());
			threads.get(i).start();
		}


		propertyListenerSupport.notifyAllListeners(
				new PropertyChangeEvent(this, THREADS, oldThreads, threads));

	}

	@Override
	public int getNumThreads() {
		return numThreads;
	}

	@Override
	public List<Thread> getThreads() {
		return threads;
	}

	@Override
	public BlockingQueue<KeyValue<K, V>> getKeyValueQueue() {
		return keyValueQueue;
	}

	@Override
	public List<LinkedList<KeyValue<K, V>>> getReductionQueueList() {
		return reductionQueueList;
	}

	@Override
	public BarrierInterface getBarrier() {
		return barrier;
	}

	@Override
	public JoinerInterface getJoiner() {
		return joiner;
	}


	@Override
	public void mergeResult(Map<K, V> newMap) {
		for (Entry<K, V> entry : newMap.entrySet()) {
			K newKey = entry.getKey();
			V newValue = entry.getValue();
			result.put(newKey, newValue);
		}
	}


}

package models.pendulum;

import java.beans.PropertyChangeEvent;
import java.beans.PropertyChangeListener;
import components.listenersupport.PropertyListenerSupport;

public class PendulumModel extends PropertyListenerSupport implements PendulumModelInterface {

	private static final int MILLISECOND_PER_SECOND = 1000;
	private static final int CENTIMETER_PER_METER = 100;
	private static final int GRAM_PER_KILOGRAM = 1000;

	private PropertyListenerSupport aPropertyListenerSupport = new PropertyListenerSupport();
	private double length, mass, gravity, friction, angle;
	private int x, y, height, width;
	private long timer, stoptimer;
	private boolean enable = true;

	public PendulumModel() {};

	public PendulumModel(int newX, int newY, double l, double m, double g, double f, double a) {
		timer = System.currentTimeMillis();
		setX(newX);
		setY(newY);
		length = l;
		mass = m;
		gravity = g;
		friction = f;
		angle = a * Math.PI/180;
	}

	@Override
	public void addPropertyChangeListener(PropertyChangeListener aListener) {
		aPropertyListenerSupport.addElement(aListener);
	}

	@Override
	public void nextPosition() {
		long t;
		if (enable) {
			t = System.currentTimeMillis() - timer;
		}
		else {
			t = stoptimer - timer;
		}

		double timeInSecond = t/MILLISECOND_PER_SECOND;
		double angleAtT = angle * Math.cos((Math.sqrt(gravity/length) * timeInSecond));

		setHeight((int) Math.round(Math.cos(angleAtT) * length));
		setWidth((int) Math.round(Math.sin(angleAtT) * length));


	}

	@Override
	public void resetTimer() {
		timer = System.currentTimeMillis();
	}

	@Override
	public void setX(int newX) {
		int oldX = x;
		x = newX;
		aPropertyListenerSupport.notifyAllListeners(
				new PropertyChangeEvent(this, "x", oldX, x));
	}

	@Override
	public void setY(int newY) {
		int oldY = y;
		y = newY;
		aPropertyListenerSupport.notifyAllListeners(
				new PropertyChangeEvent(this, "y", oldY, y));
	}

	@Override
	public void setHeight(int h) {
		int oldHeight = height;
		height = h;
		aPropertyListenerSupport.notifyAllListeners(
				new PropertyChangeEvent(this, "height", oldHeight, height));
	}

	@Override
	public void setWidth(int w) {
		int oldWidth = width;
		width = w;
		aPropertyListenerSupport.notifyAllListeners(
				new PropertyChangeEvent(this, "width", oldWidth, width));
	}


	@Override
	public void removePropertyChangeListener(PropertyChangeListener aListener) {
		aPropertyListenerSupport.removeElement(aListener);
	}

	@Override
	public void stopTimer() {
		stoptimer = System.currentTimeMillis();
		enable = false;
	}

	@Override
	public void resumeTimer() {
		timer = System.currentTimeMillis() - stoptimer + timer;
		enable = true;
	}

	@Override
	public boolean getEnable() {
		return enable;
	}


}

package components.pendulum.pendulum;

import java.beans.PropertyChangeEvent;

import components.mainpanel.MainPanel;
import components.pendulum.animator.PendulumAnimatorCommand;
import components.pendulum.load.Load;
import components.pendulum.load.LoadInterface;
import components.pendulum.string.PendulumString;
import components.pendulum.string.PendulumStringInterface;
import models.pendulum.PendulumModel;
import models.pendulum.PendulumModelFactory;
import models.pendulum.PendulumModelInterface;
import util.annotations.EditablePropertyNames;
import util.annotations.PropertyNames;
import util.annotations.StructurePattern;
import util.annotations.StructurePatternNames;
import util.annotations.Visible;

@StructurePattern(StructurePatternNames.BEAN_PATTERN)
@PropertyNames({"string", "load", "length", "mass", "angle"})
@EditablePropertyNames({"string", "load", "length", "mass", "angle"})
public class ObserverPendulum implements ObserverPendulumInterface{

	private double length = PendulumModelFactory.DEFAULT_LENGTH, 
			mass = PendulumModelFactory.DEFAULT_MASS, 
			angle = PendulumModelFactory.DEFAULT_ANGLE;
	private LoadInterface load = new Load();
	private PendulumStringInterface string;
	private PendulumModelInterface model;
	private PendulumAnimatorCommand animator;
	private boolean enable;

	public ObserverPendulum(PendulumModelInterface newModel, boolean isEnable) {
		enable = isEnable;
		model = newModel;
		string = new PendulumString(model);
		model.addPropertyChangeListener(this);
		animator = new PendulumAnimatorCommand(model);
		if (!enable) {
			stop();
		}
		animator.start();	
	}

	@Override
	public void propertyChange(PropertyChangeEvent evt) {
		if (evt.getSource() == model) {
			if ("height".equals(evt.getPropertyName())) {
				string.setHeight((int) evt.getNewValue());
				load.setY(string.getY() + (int) evt.getNewValue() - load.getHeight()/2);
			}
			else if ("width".equals(evt.getPropertyName())) {
				string.setWidth((int) evt.getNewValue());
				load.setX(string.getX() + (int) evt.getNewValue() - load.getWidth()/2);
			}
		}

	}

	@Override
	public PendulumStringInterface getString() {
		return string;
	}

	@Override
	public LoadInterface getLoad() {
		return load;
	}

	@Override
	public void setString(PendulumStringInterface newString) {
		string = newString;
	}

	@Override
	public void setLoad(LoadInterface newLoad) {
		load = newLoad;
	}

	@Override
	public void setLength(double l) {
		length = l;
		setModel();
	}

	@Override
	public void setMass(double m) {
		mass = m;
		setModel();
	}

	@Override
	public void setAngle(double a) {
		angle = a;
		setModel();
	}

	@Override
	public double getLength() {
		return length;
	}

	@Override
	public double getMass() {
		return mass;
	}

	@Override
	public double getAngle() {
		return angle;
	}

	@Override
	@Visible(false)
	public void setModel() {
		PendulumModelInterface oldModel = model;
		model = new PendulumModel(
				PendulumModelFactory.DEFAULT_X, 
				PendulumModelFactory.DEFAULT_Y, 
				length, 
				MainPanel.gravity, 
				mass, 
				MainPanel.friction, 
				angle);

		model.addPropertyChangeListener(this);
		if (!enable) {
			stop();
		}
		animator.setNewModel(model);
		oldModel.removePropertyChangeListener(this);
	}

	@Override
	public PendulumModelInterface getModel() {
		return model;
	}

	@Override
	public PendulumAnimatorCommand getAnimator() {
		return animator;
	}

	@Override
	public void stop() {
		model.stopTimer();
		enable = false;
	}

	@Override
	public void resume() {
		model.resumeTimer();
		enable = true;
	}



}

